import React from "react";
import { PINK } from "../../helpers/colors";
const Contacts = () => {
  return (
    <>
      <section className="container">
        <div className="grid">
          <div className="row">
            <div className="col">
              <p className="h3">
                <button
                  className="btn mx-2"
                  style={{ backgroundColor: PINK }}
                ></button>
              </p>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Contacts;
